INSERT INTO `parcel` (`id`, `item`, `item_type`, `item_info`, `item_co2`) VALUES
	(1, 'Kaakao', 1, 'Reilunkaupan ekologisesti tuotettu kaakaojauhe paketti, valmiissa annospusseissa. Tuore pariskunta haluaa kaakaot mukaan retkelleen. Toivottavasti muistivat tilata myös vaahtokarkit..', 40),
	(2, 'Vaahtokarkit', 1, 'Amerikkalaisia klassikko vaahtokarkkeja, suunniteltu käytettäväksi kaakaon kanssa tai notskilla paistettavaksi. Tuore pariskunta on lähdössä retkelle, ja haluaa vaahtokarkit evääksi. Toivottavasti muistivat myös kaakaon..', 20),
	(3, 'Villasukat', 1, 'Mummo on neulonut kauniit punasini raidalliset villasukat lapsenlapselleen joululahjaksi. Onpas herttaista!', 15),
	(4, 'Kahvipapuja', 3, 'Paikallinen kahvila on tilannut tukusta Etiopialaisia kahvipapuja. ', 150),
	(5, 'Juoksukengät', 1, 'Polkujuoksija tilasi kengät ultrauoksu kisaan Italian alpeillle. Toivotaan polkujuoksijalle menestystä!', 180),
	(6, 'Lautapeli', 2, 'DnD intoilija on tilannut Special Edition lautapelin, ja odottaa innoissaan kaksi vuotta sitten tilaamaansa pakettiaan..', 140),
	(7, 'Kello', 1, 'Aitoa Sveitsiläistä laatua oleva Rolex kello on matkalla Petteri Orvolle. Orpo haluaisi kovasti kellon seuraavaan edustustilaisuuteen mennessä voidakseen esitellä statustaan.', 200),
	(8, 'Pelituoli', 3, 'Katkarapuasento ei tee hyvää kellekään.. Puoliammattimaisesti pelaava CS intoilija sai fysioterapeutiltaan suosituksen panostaa ergonomiaansa.', 300),
	(9, 'Liitutaulu', 3, 'Kaikki vanha ei ole aina huonoa.. Ja matikanope Jorma ei usko nykyteknologiaan opetuksessa', 310),
	(10, 'Grillihiiliä', 3, 'Aijjaijjai.. Grillikausi on aina jossain parhaimmillaan. Egolokisempiakin ratkaisuja pihvienpaistoon kuitenkin olisi, mutta Jormaa ei kiinnosta.', 500),
	(11, 'Play Station 6', 2, 'Joko uusi pleikka on jo julkaistu tai jotakuta on huijattu pahemman kerran.. Sonya on kyllä viimisen päälle kartalla uusimmista pelijutuista, Let\'s go!', 360),
	(12, 'Hajuvesi', 1, 'Tuoksu on deittailussa kaikki kaikessa. Interrailaaja löysi ranskasta lemppari hajuvetensä, mutta reissusta ostettu pullo pääsi loppumaan. Lisää saa tilattua vain samasta pikkupuodista..', 135),
	(13, 'Lamppu', 2, 'Tämän tuotteen vastaanottaja ei ainakaan ole Tivi, sillä tivithän ovat tunnetusti pimeän eläimiä, eivätkä lamppuja käytä.. Toiset käyttää, Irmeli tilasi netistä design-lampun lukemista varten.', 245),
	(14, 'Kirkasvalolamppu', 2, 'Masentunut suomalainen opiskelija yrittää selvitä elämästään, autetaan opiskelija ylös suosta ja kaamoksesta läpi!', 235),
	(15, 'Reppu', 2, 'Reetta osti nettikirppikseltä uuden koulurepun johon uusi koodausläppärikin mahtuu. Let\'s go kierrätys!', 60),
	(16, 'Lapaset', 1, 'Shawna on neulonut todella söpöt sammakkokuvioisest villalapaset siskon pojalleen. Adorable.. ', 25),
	(17, 'Kynsikkäät', 1, 'Viljan tädillä on reuma, ja Viljapa teki tädilleen kynsikkäät helpottamaan kylmän ja oireiden kanssa.', 32),
	(18, 'Läppärinakku', 1, 'Rosen läppärin akku on kulunut loppuun, vaikka itse läppäri on vielä ihan toimiva. Rose löysi varaosan netistä, ja säästi rahaa ja luontoa!', 120),
	(19, 'Peliläppäri', 2, 'Sofia aloitti TiVillä, ja päätti panostaa kerralla opiskeluvälineisiin kunnolla. Peliläppäri on nyt matkalla uudelle koodarinalulle.', 450),
	(20, 'Kirjahylly', 3, 'Ikean kirjahyllyt ovat klassikkokamaa.. Steven kirjakokoelma on ilmeisesti hieman paisunut, toivotaan että ikean lastulevy kestää opusten painon.', 300),
	(21, 'Ilmapalloja', 1, 'Sitsit halutaan koristella ilmapalloin.', 70),
	(22, 'Tiikerikakku', 2, 'Dementiaa sairastava isoisä ajatteli muistaa lapsiaan tiikerikakulla, eikä tajunnut ajatella ettei kakun postittaminen ole aina paras idea. Toivotaan että kakku pääsee syötävässä muodossa perille.', 36),
	(23, 'Ikkunalasi', 3, 'Kuka unohti sanoa pikku Markille, ettei palloa saa potkia ikkunaa kohti? Keittiön ikkunaan tuli villien pelien seurauksena reikä, Markilla saattaa olla pallo takavarikoituna tovin.', 160),
	(24, 'Koiranruokaa', 3, 'Labradorinnoutaja Bella tarvitsee sairastumisen takia erikoismurkinat voidakseen hyvin, eikä niitä löytynyt lähieläinkaupoista. Toivottavasti Bella saadaan pian taas toipumaan.', 65),
	(25, 'Foliota', 2, 'Micky on vajonnut vuosien varrella hieman liian syvälle interwebin syövereihin, ja on tilannut rollatolkulla foliota suojautuakseen covid rokotteiden 5G signaalilta.', 40),
	(26, 'Lääkkeitä', 1, 'Monican lääkkeet ovat kokeellisia lääkkeitä harvinaiseen sairauteen, uusi läpimurto pelasti Monican. Hurraa!', 40),
	(27, 'Makuupussi', 2, 'Eräjormailija Hazel suunnitteelee reissua Yosemiteen. Hyvät yöunet ovat eräilyn onnistumisen a ja o. Hazel panostaa ekologisuuteen, ja osti kierrätysmateriaaleista tehdyn laatupussin, jolla mennään toivottavasti seuraavat 10vuotta.', 200),
	(28, 'Hiustenkuivain', 2, 'Danny on löytänyt Amazonista uuden fancyn hieustenkuivaajan. Amazon ei tunnetusti ole kovin ekologinen, nyt olisi kyllä parempiakin ostokohteita löytynyt.', 190),
	(29, 'Kiipeilykenkiä pohjaukseen', 2, 'Kaveripoppoo on lähettänyt yhdessä laatikollisen kiipeilykenkiä pohjaukseen, ja nyt ne pitäisi saada korjattuna takaisin. Propsit kaveripoppoolle ekologisemmat valinnan tekemisestä!', 70),
	(30, 'Selviytymispakkaus', 3, 'Perheen isä Rob säikähti koronaa ja sotaa, ja muutti perheen autotallin selviytymisbunkkeriksi kaiken varalle. Selviytymispaketissa on mm. trangia, kaasua, kuivamuonaa ja muita välttämättömyyksiä. ', 210);
